  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA OceanWatch provides sea surface temperature
  (SST) products derived from microwave sensors, which can measure ocean temperatures
  even in the presence of clouds.  This data is provided at moderate spatial resolution
  (0.025 degrees) for the Global Ocean.  Measurements are gathered by Japan's Advanced
  Microwave Scanning Radiometer (AMSR-E) instrument, a passive radiance sensor carried
  aboard NASA's Aqua spacecraft.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
